  selector: 'app-new-game',
  templateUrl: './new-game.component.html',
  styleUrls: ['./new-game.component.scss']
})
export class NewGameComponent extends RegionsComponent implements OnInit{
  constructor(http: PokemonService) {
    super(http)
  }
  playerPokemons: any

  ngOnInit(): void {
      this.getRegion('kanto')
  }
}
